VALUES ('8410663000149', 'Chocolate Brownie', 'Leche desnatada reconstituida, barquillo 17% [harina de trigo, azúcar, manteca de coco, emulgente: lecitina de soja, sal], salsa de chocolate 11% [agua, azúcar, jarabe de glucosa y fructosa, chocolate 5%  (pasta de cacao,azùcar, cacao en polvo desgrasado emulgente:lecitina de soja), cacao en polvo desgrasado 5%, mantequilla, manteca de coco, emulgente (E472c), aimidón, sal, acidulante (E330), estabilizante (E415) y aroma de vainillina] azúcar, recubrimiento del barquillo 9% [chocolate (azúcar, pasta de cacao. manteca de cacao. emulgente: lecitina de soja. Cacao: 44% mínimo), manteca de coco] trozos de bizcocho de chocolate (7%) [azúcar, harina de trigo, aceite de colza, agua, jarabe de glucosa, huevo en polvo. cacao desgrasado en polvo, emulgente (monoglicéridos y diglicéridos de ácidos grasos), sal] manteca de coco, jarabe de glucosa y fructosa, suero de leche en polvo, cacao en polvo desgrasado 3,9%, emulgente (monoglicéridos ydiglicéridos de ácidos grasos), estabilizantes (goma guar, carragenanos, goma garrofin), proteinas de la leche y sal.', 'https://static.openfoodfacts.org/images/products/841/066/300/0149/front_es.6.400.jpg', '11', '9', '42', '32', '2', '4', '0.2', '0.078740157480315', '', '0');

