INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('8410705035115', 'Quinoa con kale y lentejas', 'PLATO PREPARADOA BASE DE QUINOA, VEGETALESY LENTEJAS. ULTRACONGELADO. INGREDIENTES: quinoa (45), mezda de vegetales (43) (calabacin frito,zanahoria (89%), pimiento rojo, champiñón frito, brocoli (5%), col kale (5%), judía verde (49%), cebolla frita], lentejas (69%), pipas de calabaza, aceite de girasol, caldo deshidratado de vegetales,potendiador del sabor (glutamato monosódico), sal. Consultar trazas alérgenos. Preparación: No es necesario descongelar. Sartén: Poner en la sartén 4 cucharadas de aceite. Verter el contenido y saltear durante 3 minutos. Añadir4 cucharadas de agua y saltear 3 minutos más Microondas 800 W: Poner el contenido en un redipiente adecuado para microondas. Añadir 2 cucharadas de aceite, tapar, calentar dos minutos, removery volver a calentar 2 minutos más.', 'https://static.openfoodfacts.org/images/products/841/070/503/5115/front_es.3.400.jpg', '4.9', '1.8', '9.4', '1.6', '2.4', '4.5', '1', '0.393700787401575', '', '1');

